import React from 'react';
const icon =  require('./icon.png');

interface IProps {
  alt: string;
}

const CartWidget = ({alt}: IProps) => {

  return (
  <>
    <img id="cart" src={icon} alt={alt}/>
  </>
  );
};

export default CartWidget;
